import React from "react";
import { Form, Link } from "react-router-dom";

export default function Login(){
    return(
        <>
        <div id="login-page">
            <h1>Sign into your account </h1>

<div id="formdiv">
        <form id="login-form">
            <input type="email" className="login-inputs" id="email-input" placeholder="E-mail" />

            <input type="password" className="login-inputs" id="password-input" placeholder="Password"/>


<br/>
            <button id="sign-in-btn">Sign in</button>
            </form>
            </div>

            <p>Don't have an account? <Link to=""> Create one now</Link></p>

            </div>

        </>
    )
}
